// pages/api/upload-screenshot.js
import type { NextApiRequest, NextApiResponse } from 'next'
import s3 from '../../../utils/aws';
import { google } from 'googleapis';
export default async  function handler(req:NextApiRequest, res:NextApiResponse) {
    if (req.method === 'POST') {
      // Get the screenshot data from the request body
      const {address, title,description } = req.body;
      const screenshot="data:image/png;base64,"
      const Datetime=new Date();
      const auth=new google.auth.GoogleAuth({
        credentials:{
          client_email:process.env.NEXT_PUBLIC_GOOGLE_CLIENT_EMAIL,
          private_key:process.env.NEXT_PUBLIC_GOOGLE_PRIVATE_KEY?.replace(/\\n/g,"\n")

        },
        scopes:[
          'https://www.googleapis.com/auth/drive',
          'https://www.googleapis.com/auth/drive.file',
          'https://www.googleapis.com/auth/spreadsheets'
        ]
       })
       const sheets=google.sheets({
        auth,
        version:'v4'
       })
       const params={
        Bucket:'common-static-assets',
        Key: `feedback-test/${Datetime}_screenshot.png`,
        Body:Buffer.from(screenshot,'base64'),
        ContentType:'image/png'
      }
      const fetchParams = {
        Bucket: 'common-static-assets',
        Key:`feedback-test/${Datetime}_screenshot.png`,
      };
      //  console.log(Buffer.from(screenshot, 'base64'))
      try{
        if(screenshot){
          await s3.upload(params).promise();
          s3.getSignedUrl('getObject', fetchParams, (error, url) => {
            if (error) {
              console.error('Error generating signed URL:', error);
            } else {
              console.log('Public URL:', url);
            }
          });
          console.log('Screenshot uploaded successfully');
          return res.status(200).json({
            message:"Bug reported"
          })
          
        }else{
          if(!title ||!description){
            res.status(400).json({ error: 'Title and description is required' });
            return;
          }
          const response=await sheets.spreadsheets.values.append({
            spreadsheetId:process.env.NEXT_PUBLIC_GOOGLE_SHEET_ID_BUGS,
            range:'A1:E1',
            valueInputOption:'USER_ENTERED',
            requestBody:{
              values:[
                [
                  Datetime,address,title,description,screenshot
                ]
              ]
            }
         })
         res.status(200).json(
           { 
             message: 'Bug reported  successfully',
            //  data:response.data
           }
           );
        }
      }catch(err){
        console.log(err,"aws")
      }
  
      // Process the screenshot data, e.g., save it to a file or a database
      // You may need to decode the data URL and save it as an image file
  
      // Send a response back to the frontend

    } else {
      res.status(405).end(); // Method Not Allowed
    }
  }
  